  yOffset: 0,
  xOffset: 0,
  transform: ''
};
export const BackwardIcon = props => {
  const newProps = Object.assign({
    config: BackwardIconConfig
  }, props);
  return React.createElement(SVGIcon, newProps);
};
export default BackwardIcon;
